descricao:
Subscrito pelo Dep. Delegado Edson Moreira.
Aprovado com alterações: o escopo da audiência pública será o debate das propostas das polícias civil e militares.
Incluídos os convidados:
 - Prof. Dr. Antônio Álvares da Silva, Professor Titular da Universidade Federal de Minas Gerais e ex-Desembargador Federal do Trabalho do Tribunal Regional do Trabalho 3ª Região;
- Prof. Claudio Chaves Beato Filho, Universidade Federal de Minas Gerais;
- Fórum Brasileiro de Segurança Pública;
- Movimento Nacional de Direitos Humanos.

ultimaApresentacaoProposicao_descricao:
Apresentação do Requerimento de Audiência Pública n. 160/2016, pelo Deputado Rogério Marinho (PSDB-RN), que: "Requer que seja realizada Reunião de Audiência Pública para discussão da Base Nacional Comum Curricular - BNCC frente ao Pacto Federativo, com presença dos Senhores Eduardo Deschamps - Presidente do Consed;
Alessio Costa Lima - Presidente Undime; Binho Marques - Secretário de Articulação dos Sistemas de Ensino; José Renato Nalini - Secretário de Estado de Educação de São Paulo; e Julio Gregório Filho - Secretário de Educação do Distrito Federal.
".

Apresentação do Requerimento de Audiência Pública n. 121/2016, pelo Deputado José Rocha (PR-BA), que: "Requer sejam convidados os representantes do Ministério de Minas e Energia, da  Empresa de Pesquisa Energética(EPE), da Associação Brasileira de Energia Eólica(Abeólica), da Associação Brasileira de Energia Solar(Absolar) e da Associação Brasileira dos Produtores Independentes de Energia Elétrica(APINE), para debater a situação do setor brasileiro de energias renováveis, solar e eólica, com destaque para os seguintes tópicos: Situação atual do setor/projetos em execução; Perspectivas de expansão;
Entraves para a expansão(legislação, incentivos, financiamento, tecnologia/produção de equipamentos).

".
